import React from 'react';
import { CardImg, Col, Container } from 'react-bootstrap';
import AppNavBar from '../layouts/AppNavbar';
import logo from "./../img/freely-logo-final.png";
export default function Download() {
	const gotoLink = () => {
		window.open("https://play.google.com/store/apps/details?id=com.freellyapp", "_blank");
			};


	return (
		<div>
			<AppNavBar/>
			<Container>
		<div style={{
			display: 'flex',
				alignItems: 'center',
				justifyContent: 'center',
		marginTop:120,

		}}>
		<CardImg
			alt="Card image cap"
			bottom
			src={logo}
			style={{
				width:"40%"
			}}
			/>
		</div>
			</Container>
			<Container>
			<Col xl={12} lg={5} md={5} xs={12} className="mt-5 mb-5 banner justify-content-center align-items-center">
				<h2>Freelly অ্যাপ ডাউনলোড করতে নিচের লিংকগুলো ভিজিট করুন </h2>
				</Col>

	<div className="banner justify-content-center align-items-center">
		<button className="downloadApp-banner-play" onClick={gotoLink}></button>
			<button className="downloadApp-banner-ios" onClick={gotoLink}></button>
			</div>

		</Container>
		</div>
	)
}
